import React, {Component, Children, PropTypes} from 'react';
import './Menu.css';

class Menu  extends Component {

	constructor(props) {
		super(props);
		this.toggleMenuItems = this.toggleMenuItems.bind(this);
	}

	toggleMenuItems() {
		$(this.refs['menu-items']).toggle();
	}

	render() {
		return (
			<div className={'Menu'}>
				<button onClick={this.toggleMenuItems}>
					<div className={'line'} />-
					<div className={'line'} />-
					<div className={'line'} />-
				</button>
				<div className={'menu-items'} ref={'menu-items'}>
					<div className={'menu-item'}>About</div>
					<div className={'menu-item'}>Skills</div>
					<div className={'menu-item'}>Portfolio</div>
					<div className={'menu-item'}>Contact</div>
				</div>
			</div>
		);
	}
}

export default Menu;
